contract BullishSwap is Ownable, ERC721A, ReentrancyGuard {
    bool public publicSale = false;
    bool public publicClaim = false;    
    bytes32 private root;
    uint256 public maxToken = 10000;
    uint256 public count_per_step  = 1000;
    uint256 public maxPublicMinted = 3;
    uint256[] public priceList = [
        0.015 ether,
        0.025 ether,
        0.035 ether,
        0.05 ether,
        0.1 ether,
        0.2 ether,
        0.3 ether,
        0.4 ether,
        0.5 ether,
        0.6 ether
    ];
    string private _baseTokenURI;
    mapping(address => uint256) public publicMinted;
    mapping(address => uint256) public whitelistMinted;
    mapping(address => uint256) public rewardsPersent;
    mapping(address => uint256) public discountPersent;

    constructor(string memory _NAME, string memory _SYMBOL, string memory baseTokenURI)
        ERC721A(_NAME, _SYMBOL, 1000, maxToken)
        {_baseTokenURI = baseTokenURI;}    


    function verify(bytes32[] memory proof, address addr, uint256 amount) public view returns (bool) {
        bytes32 leaf = keccak256(bytes.concat(keccak256(abi.encode(addr, amount))));
        require(MerkleProof.verify(proof, root, leaf), "INVALID PROOF");
        return true;
    }
    function getCurrentSumm(uint256 amount, address refferer) public view returns (uint256) {
        uint256 totalSumm;
        uint256 count_steps;
        uint256 remainder; 
        remainder = totalSupply() % count_per_step;
        count_steps =  (totalSupply() - remainder ) / count_per_step;

        if (amount > (count_per_step - remainder)) {            
            totalSumm = (count_per_step - remainder) * priceList[count_steps];
            totalSumm += (amount - (count_per_step - remainder)) * priceList[count_steps+1];
        } else {
            totalSumm = amount * priceList[count_steps];
        }
        totalSumm = totalSumm * (100 - discountPersent[refferer]) / 100;

        return totalSumm;
    }
    function mint(uint256 amount, address refferer) external payable  {
        address _to = msg.sender;        
        uint256 currentSumm = getCurrentSumm(amount, refferer);
        uint256 incomeSumm = msg.value;

        require(currentSumm <= incomeSumm || _to == owner() , "NOT_ENOUGH_ETH");
        require(totalSupply() + 1 <= maxToken || _to == owner(), "NOT_ENOUGH_SUPPLY_TO_MINT");
        require(publicSale || _to == owner(), "SALE_HAS_NOT_STARTED_YET");
        require(publicMinted[_to] + amount <= maxPublicMinted || _to == owner(), "LIMIT_OF_TOKENS_PER_WALLET");

        _safeMint(_to, amount);
        
        publicMinted[_to] += amount;
        // Set the reward percentage if it has not already been set previously
        if(rewardsPersent[_to] == 0){
            rewardsPersent[_to] = 10;
        }        
        // Set the discount percentage if it has not already been set previously
        if(discountPersent[_to] == 0){
            discountPersent[_to] = 10;
        }
        uint256 rewardPersent = rewardsPersent[refferer];
        if (rewardPersent > 0) {
            uint256 rewardValue = incomeSumm * rewardPersent/100;
            payable(refferer).transfer(rewardValue);
        }
    }
    function getClaimEnable(bytes32[] memory proof, address _to, uint256 allAmount) public view returns (uint256) {
        require(verify(proof, _to, allAmount), "NOT_IN_THE_WHITE_LIST");
        uint256 minted = whitelistMinted[_to];
         if (allAmount <= minted) {
            return 0;
        } else {
            return allAmount - minted;
        }
    }
    function claim(bytes32[] memory proof, uint256 allAmount, uint256 claimAmount) external payable  {   
        address _to = msg.sender;        
        uint256 enableCount = getClaimEnable(proof, _to, allAmount);

        require(claimAmount <= enableCount, "NOT_ENOUGH_WL_TO_MINT");
        require(verify(proof, _to, allAmount), "NOT_IN_THE_WHITE_LIST");
        require(publicClaim, "CLAIM_HAS_NOT_STARTED_YET");
        require(totalSupply() + 1 <= maxToken, "NOT_ENOUGH_SUPPLY_TO_MINT");

        whitelistMinted[_to] += claimAmount;
        _safeMint(_to, claimAmount);
    }
    function setMaxPublicMinted(uint256 value) external onlyOwner {
        maxPublicMinted = value;
    }
    function setCustomRewards(address user, uint256 value) external onlyOwner {
        require(value <= 99,"Invalid value");
        rewardsPersent[user] = value;
    }
    function setCustomDiscount(address user, uint256 value) external onlyOwner {
        require(value <= 99,"Invalid value");
        discountPersent[user] = value;
    } 
    function flipPublicSaleState() external onlyOwner {
        publicSale = !publicSale;
    }    
    function flipPublicClaim() external onlyOwner {
        publicClaim = !publicClaim;
    }
    function setBaseURI(string calldata baseURI) external onlyOwner {
        _baseTokenURI = baseURI;
    }
    function setRoot(bytes32 _root) external onlyOwner {
        root = _root;
    }
    function setPrice(uint256 stepPrice, uint256 value) external onlyOwner {
        priceList[stepPrice] = value;
    }
    function withdraw() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }
    function numberMinted(address owner) public view returns (uint256) {
        return _numberMinted(owner);
    }
    function getOwnershipData(uint256 tokenId) external view returns (TokenOwnership memory){
        return ownershipOf(tokenId);
    }
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory){
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory _tokenURI = super.tokenURI(tokenId);
        return
            bytes(_tokenURI).length > 0
                ? string(abi.encodePacked(_tokenURI, ".json"))
                : "";
    }
    function _baseURI() internal view virtual override returns (string memory) {
        return _baseTokenURI;
    }    
    function tokensOfOwner(address _owner) external view returns(uint256[] memory) {
        uint tokenCount = balanceOf(_owner);
        uint256[] memory tokensId = new uint256[](tokenCount);
        for(uint i = 0; i < tokenCount; i++){
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }    
}
